import React from 'react'

export const TodoItem = () => {
  const items = [
    {
      sno: 1,
      title: "Go to Market",
      desc: "Job 1"
    },
    {
      sno: 2,
      title: "Go to Mall",
      desc: "Job 2"
    },
    {
      sno: 3,
      title: "Go to Ghat",
      desc: "Job 3"
    }
  ]

  return (
    <>
      {items.map((items) => (
        <div>
        <li key={items.id}>
          <h2> {items.title} </h2>
          <p> {items.desc} </p>
          <button type="button" class="btn btn-danger btn-sm">Delete</button>
        </li>
        </div>
      ))}
    </>

  )
}
